import React, { Component } from "react";
import Navbar from '../navbar/navbar'
import './recommendation.css'
class recommendation extends Component{

    constructor(){
        super();
        this.state={
            RecommendedBooks:[]
        }
        axios.get("http://localhost:3000/recommendation").then((Result)=>{
            this.setState({RecommendedBooks: Result.data});
            const email ={email:this.props.match.params.email}
            console.log(email);
    })
    }

    render(){
        return(
            <div>
              <div>
                <Navbar/>
                </div>  
           
            <div>
                <h1>Recommended books for you</h1>
            </div>
            </div> 
        )
    }

}
export default recommendation;
